import { useState } from "react"



function Login(){

    const [state,setState] = useState()


    const login = async () =>{
        var email = document.getElementById("email").value
        setState(email)
    }

    return(
        <div>
            <input placeholder="Insira seu E-mail" id="email"/>
                        <button onClick={()=>{login}}>
                entrar
            </button>
            {state}
        </div>
    )


}export default Login
